import React from 'react'
import Dron from "../image/dron.jpeg"
import Camera from "../image/camera.jpg"
import Headphones from "../image/headphones.jpg"
import "../css/carousel.css"

document.addEventListener("DOMContentLoaded", function () {
  // Get all slides and thumbnails
  const slides = document.querySelectorAll(".item");
  const thumbnails = document.querySelectorAll(".thumbnail li");

  let currentSlide = 0;

  // Display the initial slide
  showSlide(currentSlide);

  // Add click event listeners to thumbnails
  thumbnails.forEach((thumbnail, index) => {
    thumbnail.addEventListener("click", () => {
      showSlide(index);
    });
  });

  // Function to display the selected slide
  function showSlide(index) {
    // Hide all slides
    slides.forEach((slide) => {
      slide.style.display = "none";
    });

    // Deactivate all thumbnails
    thumbnails.forEach((thumbnail) => {
      thumbnail.classList.remove("active");
    });

    // Display the selected slide
    slides[index].style.display = "block";

    // Activate the corresponding thumbnail
    thumbnails[index].classList.add("active");

    // Update the current slide index
    currentSlide = index;
  }
});



export default function Carousel() {
  return (
    <div>
         <div>
    <section className="ftco-section">
      <div className="container">
        <div className="row">
          <div className="col-md-12 text-center">
            <h2 className="heading-section mb-5 pb-md-4">Our Products!!</h2>
          </div>
          <div className="col-md-12">
            <div className="slider-hero">
              <div >
                <div className="item">
                  <div className="work">
                    <div
                      className="img d-flex align-items-center justify-content-center"
                    >
                       <img
          src={Dron}
          alt="dron"
          draggable="false"
        />
                      <div className="text text-center">
                        <h2>Discover New Places</h2>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="item">
                  <div className="work">
                    <div
                      className="img d-flex align-items-center justify-content-center"

                    >
                       <img
          src={Camera}
          alt="camera"
          draggable="false"
        />
                      <div className="text text-center">
                        <h2>Dream Destination</h2>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="item">
                  <div className="work">
                    <div
                      className="img d-flex align-items-center justify-content-center"

                    >
                       <img
          src={Headphones}
          alt="headphones"
          draggable="false"
        />
                      <div className="text text-center">
                        <h2>Travel Exploration</h2>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
              <div className="my-5 text-center">
                <ul className="thumbnail">
                  <li className="active img">
                    <a href="#">
                      <img
                        src={Dron}
                        alt="dron"
                        draggable="false"
                        className="img-fluid"
                      />
                    </a>
                  </li>
                  <li>
                    <a href="#">
                      <img
                          src={Camera}
                          alt="camera"
                          draggable="false"
                        className="img-fluid"
                      />
                    </a>
                  </li>
                  <li>
                    <a href="#">
                      <img
                          src={Headphones}
                          alt="headphones"
                          draggable="false"
                        className="img-fluid"
                      />
                    </a>
                  </li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  </div>


    </div>
  )
}
